sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {
	return !api.state.active_worker || api.data.get_qualified_positions_for_shift_workers_1.output.proficient[api.state.active_worker].some(function(it) {
    return it.sys_id == api.item.value.position.value;
  });
}
